import React from 'react';
import MottoQuality from '../MottoQuality';
import Footer from '../Footer';
import OurValues from '../OurValues';
import OurStrength from '../OurStrength';

function Innovation() {
  return (
    <>
      <MottoQuality/>
      <OurValues />
      <OurStrength />
      <Footer/>
    </>
  );
}

export default Innovation;
